import React from 'react';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';

export default function SimpleMenu() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = event => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div>
      <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
        Open Menu
      </Button>
      <Menu
        id="simple-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose}>Driss</MenuItem>
        <MenuItem onClick={handleClose}>Mohsine</MenuItem>
        <MenuItem onClick={handleClose}>Abdelghani</MenuItem>
        <MenuItem onClick={handleClose}>Hamza Ouzeno</MenuItem>
        <MenuItem onClick={handleClose}>Big Hamza</MenuItem>
        <MenuItem onClick={handleClose}>Ahmed</MenuItem>
        <MenuItem onClick={handleClose}>Simo</MenuItem>
      </Menu>
    </div>
  );
}
